import React, { Component } from 'react';
import {fetchAPI} from './CallAPIService.js';
import {Link} from "react-router-dom";

class Counter extends Component { 
    state = {
        message: '',
        
    };
    buttonClicked =() =>{
        //const response = await fetch("http://localhost:9000").then(console.log("fetch from api")).then(res => res.text());
        console.log("click");
        const response = fetchAPI(window.location.pathname);
        console.log("Message received");
        console.log(response);
        this.setState({ message: "response"});
    }
    render() { 
        return <div className='div'>
            
            <span>{this.state.message}</span>
            <div>
            
            <button 
            onClick={this.buttonClicked}
            className = "btn btn-primary btn-sm">pipo</button>
            </div>
            <div>
            <Link to= "login"><button className = "btn btn-secondary btn-sm">login</button></Link>
            <Link to = "/"><button className = "btn btn-secondary btn-sm">Home</button></Link>
            </div>
           
        </div>;
    }
    
}
 
export default Counter;
